import React from 'react'
import { Field, reduxForm } from 'redux-form'

const Form = props => {
  console.log('props zde', props)
  return (
    <form>
      <input type="text" name="someText" placeholder="HTML input" />
      <br />
      <Field
        type="text"
        component="input"
        placeholder="ReduxForm Field"
        name="Field"
      />
    </form>
  )
}

export default reduxForm({
  form: 'testForm',
})(Form)
